JESUS CHRIST DIED FOR OUR SINS WAS BURIED AND ROSE AGAIN THE THIRD DAY.1 Corinthians 15:1-4 (KJV)  Moreover, brethren, I declare unto you the gospel which I preached unto you, which also ye have received, and wherein ye stand;
By which also ye are saved, if ye keep in memory what I preached unto you, unless ye have believed in vain.
For I delivered unto you first of all that which I also received, how that Christ died for our sins according to the scriptures;
And that he was buried, and that he rose again the third day according to the scriptures:(THIS IS THE GOSPEL)
